import React, { Fragment } from "react";

const Footer = () => {
  return (
    <Fragment>
      <div className="footer-left">Made with &#10084; by Niloy</div>
      <div className="footer-right">Made with &#10084; by Niloy</div>
    </Fragment>
  );
};

export default Footer;
